import React, { useState } from 'react';
import axios from 'axios';
import { Form, Button } from 'react-bootstrap';

const ReportEmergency = () => {
  const [description, setDescription] = useState('');
  const [location, setLocation] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://127.0.0.1:8000/emergencies/', { description, location });
      alert('Emergency reported successfully');
    } catch (error) {
      console.error('Error reporting emergency', error);
    }
  };

  return (
    <Form onSubmit={handleSubmit}>
      <Form.Group controlId="formDescription">
        <Form.Label>Description</Form.Label>
        <Form.Control type="text" value={description} onChange={(e) => setDescription(e.target.value)} placeholder="Enter description" required />
      </Form.Group>
      <Form.Group controlId="formLocation">
        <Form.Label>Location</Form.Label>
        <Form.Control type="text" value={location} onChange={(e) => setLocation(e.target.value)} placeholder="Enter location" required />
      </Form.Group>
      <Button variant="danger" type="submit">
        Report Emergency
      </Button>
    </Form>
  );
};

export default ReportEmergency;
